import React, { useEffect, useState } from "react";
import "./addtocart.css";
import { DataMenu } from "../../Apimenu";
import { NavLink, useParams } from "react-router-dom";
const Addtocart = () => {
  const { id } = useParams();
  const [data, setData] = useState();
  const [incMoney, setIncmoney] = useState(0);
  const [incItem, setIncitem] = useState(0)
  const incricebtn = (price) => {
    setIncitem(incItem + 1);
    setIncmoney(incMoney + price)
  }
  const decricebtn = (price) => {
    if (incItem == 0 || incItem < 0) {
      alert("please add item")
    }
    else {
      setIncitem(incItem - 1);
    }

    setIncmoney(incMoney - price)

  }
  useEffect(() => {
    const Filterdata = DataMenu.filter((val) => {
      return val.id == id
    })
    setData(Filterdata);
  }, [id])
  return (
    <>
      <section className="addtocart-section">
        <div className="container">
          <div className="row">
            <div className="border flex">
              <div className="sub-border"></div>
              <div className="sub-border"></div>
              <div className="sub-border"></div>
              <div className="sub-border"></div>
              <div className="sub-border"></div>
            </div>
            <div className="content">
              <div className="main-box flex">
                {
                  data && data.map((val) => {
                    const { id, name, image, price } = val;
                    return (
                      <div className="box" key={id}>

                        <div className="content flex">
                          <div className="image">
                            <img src={image} alt="product-photo" />
                          </div>
                          <div className="details">
                            <marquee behavior="scroll" direction="left">hurry up order fast before food is out off stock</marquee>
                            <div className="title flex">
                              <h5>{name}</h5>
                              <span>₹{price}</span>
                            </div>
                            <p>Lorem ipsum dolor sit, amet consectetur adipisicing elit. At nostrum laudantium consequuntur dolorem. Quibusdam atque dolorum quas suscipit quidem quia deserunt aperiam laudantium ad? Ipsa quasi omnis modi laudantium corporis?</p>
                            <div className="btn">
                              <ul className="flex">
                                <li className="flex"><button onClick={() => decricebtn(price)}>-</button><h5>{incItem}</h5><button onClick={() => incricebtn(price)}>+</button></li>
                                <li><NavLink><button>pay:-{incMoney}</button></NavLink></li>
                              </ul>
                            </div>
                          </div>
                        </div>

                      </div>
                    );

                  })
                }
                <div className="box">
                  <div className="content">
                    <form action="#">
                      <div className="input-box flex">
                        <label htmlFor="name">cash on delivery</label>
                        <input type="radio" name="payment" required checked />
                        <label htmlFor="name">G-pay</label>
                        <input type="radio" name="payment" />
                      </div>
                      <div className="form-box flex">
                      <div className="box">
                      <div className="input-box">
                        <label htmlFor="name">Name</label>
                        <input type="text" placeholder="name" required />
                      </div>
                      <div className="input-box">
                        <label htmlFor="mnumber">mobile number</label>
                        <input type="number" placeholder="+91 0123456789" required />
                      </div>
                      <div className="textarea-box">
                        <label htmlFor="address">address</label>
                        <textarea name="address" id="address" required rows={2} placeholder="enter your address"></textarea>
                      </div>
                      </div>
                      <div className="box">
                      <div className="image">
                        <img src="../../../Image/IMG_6675.PNG" alt="" />
                      </div>
                      </div>                                     
                      </div>                     
                      <div className="btn flex">
                        <button type="submit">order</button>
                      </div>
                    </form>
                  </div>
                </div>
              </div>
            </div>
          </div>
        </div>
      </section>
    </>
  );
}
export default Addtocart;
